}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32">  <g>    <polygon points="2 11 5 11 5 5 11 5 11 2 2 2 2 11" fill="#fff"/>    <polygon points="27 27 21 27 21 30 30 30 30 21 27 21 27 27" fill="#fff"/>    <polygon points="5 21 2 21 2 30 11 30 11 27 5 27 5 21" fill="#fff"/>    <polygon points="21 2 21 5 27 5 27 11 30 11 30 2 21 2" class="aw-theme-iconOutline" fill="#fff"/>  </g></svg>';
